import React, { Component } from 'react';
import { Redirect } from 'react-router-dom';
//import './login.css';
import axios from 'axios';
import './index.css';



class Login extends Component {


    state = {
        redirect: false
    }
    setRedirect = () => {

    }
    renderRedirect = () => {
        if (this.state.redirect) {
            return <Redirect to='/homepage' />
        }
    }

    constructor(props) {
        super(props)
        this.state = {
            username: '',
            password: ''

        }

    }
    changeHandler = e => {
        this.setState({ [e.target.name]: e.target.value })
    }

    submitHandler =( e )=> {
        e.preventDefault()
        console.log(this.state)
        axios
            .post('http://3b31db62.ngrok.io/authenticate', this.state)
            .then(response => {

                console.log(response)


            })
            .catch(error => {

                console.log(error)

            })

            this.setState({
                redirect: true
            })


    }






    render() {
        const { username, password } = this.state
        return (
           <div classname="full">
            {/* <div className="container"> */}<div>
             {/* <div className="navbar"> */}
                  <div>

               <nav className="contain">
                    <img src={require("/home/nineleaps/Desktop/onproject/onproject/src/Component/pages/Login/logo.png")} />
                    <ul>
                        <li>onboarding</li>

                    </ul>
                </nav>
                </div>

                <div className="image">
                <img src={require("/home/nineleaps/Desktop/onproject/onproject/src/Component/pages/Login/kkk.png")} />
                </div>

                <div className="content-body">
                    <form onSubmit={this.submitHandler} >
                        <div className="inputfield">
                            <p>Email :</p>
                            <input type="text" name="username" value={username} onChange={this.changeHandler} placeholder="Email address" style={{ width: "360px" }} />
                        </div>

                        <div className="inputfield">
                            <p>Password :</p>
                            <input type="password" name="password" value={password} onChange={this.changeHandler} placeholder="Password" style={{ width: "360px" }} />
                        </div>

                        <div className="button" >
                            {this.renderRedirect()}
                            <input type="submit" value="Login" onClick={this.submitHandler} style={{ backgroundColor: "#007bff" }} />
                            {/* <button onClick={this.setRedirect}>Homepage</button> */}
                        </div>

                    </form>


                </div>

                     <div className="footer">
                        <p>Nineleaps</p>
                    </div> 
            </div>

            </div>

        );

    }
}

export default Login;
